KalmanFilter kf;
VIP_ENCFLOAT kf_predictions[DATASET_SIZE][3];

int
main(void)
{
  unsigned step = 0;

  // initialize the privacy enhanced execution target
  VIP_INIT;

  // initialize the pseudo-RNG
  mysrand(42);
  // mysrand(time(NULL));

  // set up Kalman filter
  kf.init(3);
  kf.setProcessNoise(0.1, 0.01);
  kf.setMeasurementNoise(0.1);
 
  {
    Stopwatch s("VIP_Bench Runtime");

    // set initial state
    VIP_ENCFLOAT tuple[3] = { kf_rawdata[0][1], kf_rawdata[0][2], kf_rawdata[0][3] };
    kf.set(tuple, 3);

    for (; step < DATASET_SIZE; step++)
    {
      // Kalman filter step
      kf.predict((VIP_ENCFLOAT)kf_rawdata[step][0]/1000.0);
      kf.get(&kf_predictions[step][0], 3);
      VIP_ENCFLOAT tuple[3] = { kf_rawdata[step+1][1], kf_rawdata[step+1][2], kf_rawdata[step+1][3] };
      kf.correct(tuple, 3);
    }
  }

  // dump the results
  fprintf(stdout, "INFO: dumping %d Kalman accelerometer (x,y,z) predictions...\n", DATASET_SIZE);
  for (step=0; step < DATASET_SIZE; step++)
  {
    // fprintf(stdout, "input step[%u]=(x:%f,y:%f,z:%f)\n", step, kf_rawdata[step][1], kf_rawdata[step][2], kf_rawdata[step][3]);
    fprintf(stdout, "step[%u]=(x:%f,y:%f,z:%f)\n",
            step, VIP_DEC(kf_predictions[step][0]), VIP_DEC(kf_predictions[step][1]), VIP_DEC(kf_predictions[step][2]));
  }
  return 0;
}

